import React, { useState, useEffect } from "react";
import axios from "axios";

function App() {
  const [data, setData] = useState({ data: [] });
  const [chages, setChanges] = useState("");
  const [url, setUrl] = useState(
    `https://api.coindesk.com/v1/bpi/historical/close.json?start=2019-11-28-01&end=2019-12-13`
  );
  //`https://api.coindesk.com/v1/bpi/historical/close.json?start=${chages}-01&end=2019-12-13`

  useEffect(() => {
    const fetchData = async () => {
      const response = await axios(url);
      setData(response);
    };
    fetchData();
  }, [url]);
